Two vertices of the first parallelogram are at $(0,c)$ and $(0,d)$.

[asy]
unitsize(0.5 cm);

pair P, Q, R, S;

P = (0,9);
Q = (3,12);
R = (0,3);
S = (-3,0);

draw(interp(P,Q,-0.4)--interp(P,Q,1.4));
draw(interp(R,S,-0.4)--interp(R,S,1.4));
draw(interp(P,S,-0.2)--interp(P,S,1.2));
draw(interp(Q,R,-0.2)--interp(Q,R,1.2));

label("$y = ax + c$", interp(S,R,1.4), E);
label("$y = ax + d$", interp(P,Q,1.4), E);
label("$y = bx + c$", interp(Q,R,1.2), SE);
label("$y = bx + d$", interp(P,S,1.2), SE);

dot("$(0,c)$", R, SE);
dot("$(0,d)$", P, NW);
[/asy]

The $x$-coordinates of the other two vertices satisfy $ax+c=bx+d$ and $ax+d=bx+c$, so the $x$-coordinates are $\pm(c-d)/(b-a)$. Thus the parallelogram is composed of two triangles, each of which has area \[
9=\frac{1}{2} \cdot |c-d| \cdot \left|\frac{c-d}{b-a}\right|.
\]It follows that $(c-d)^2=18|b-a|$.

By a similar argument using the second parallelogram, $(c+d)^2=72|b-a|$. Subtracting the first equation from the second yields $4cd=54|b-a|$, so $2cd = 27|b-a|$. Thus $|b-a|$ is even, and $a+b$ is minimized when $\{a,b\}=\{1,3\}$. Also, $cd$ is a multiple of 27, and $c+d$ is minimized when $\{c,d\}=\{3,9\}$. Hence the smallest possible value of $a+b+c+d$ is $1+3+3+9=\boxed{16}$. Note that the required conditions are satisfied when $(a,b,c,d)=(1,3,3,9)$.

To save the most rope, we must have $HP$ having minimum length.
For $HP$ to have minimum length, $HP$ must be perpendicular to $CD$. [asy]
pair C, D, H, P;
H=(90,120);
C=(0,0);
D=(140,0);
P=(90,0);
draw(H--C--D--H--P);
label("H", H, N);
label("C", C, SW);
label("D", D, SE);
label("P", P, S);
label("150", (C+H)/2, NW);
label("130", (D+H)/2, NE);
[/asy] (Among other things, we can see from this diagram that sliding $P$ away from the perpendicular position does make $HP$ longer.)
In the diagram, $HC=150$, $HD=130$ and $CD=140$.
Let $HP=x$ and $PD=a$.  Then $CP=140-a$.
By the Pythagorean Theorem in $\triangle HPC$, $x^2 + (140-a)^2 = 150^2$.
By the Pythagorean Theorem in $\triangle HPD$, $x^2+a^2 = 130^2$.
Subtracting the second equation from the first, we obtain \begin{align*}
(140-a)^2 - a^2 & = 150^2 - 130^2 \\
(19600 - 280a+a^2)-a^2 & = 5600 \\
19600 -280a & = 5600 \\
280a & = 14000 \\
a & = 50
\end{align*} Therefore, $x^2 + 90^2 = 150^2$ or $x^2 = 150^2 - 90^2 = 22500 - 8100 = 14400$ so $x =120$.
So the shortest possible rope that we can use is 120 m, which saves $130+150-120 = \boxed{160}$ m of rope.

Let the equation of a tangent line be $y = mx + b.$

Substituting into the equation $x^2 + y^2 = 2,$ we get
\[x^2 + (mx + b)^2 = 2.\]Then $(m^2 + 1) x^2 + 2bmx + (b^2 - 2) = 0.$  Since we have a tangent, this quadratic has a double root, meaning that its discriminant is 0.  This gives us
\[(2bm)^2 - 4(m^2 + 1)(b^2 - 2) = 0,\]which simplifies to $b^2 = 2m^2 + 2.$

Solving for $x$ in $y = mx + b,$ we get $x = \frac{y - b}{m}.$  Substituting into $y^2 = 8x,$ we get
\[y^2 = \frac{8y - 8b}{m},\]so $my^2 - 8y + 8b = 0.$  Again, the discriminant of this quadratic will also be 0, so
\[64 - 4(m)(8b) = 0.\]Hence, $bm = 2.$

Then $b = \frac{2}{m}.$  Substituting into $b^2 = 2m^2 + 2,$ we get
\[\frac{4}{m^2} = 2m^2 + 2.\]Then $4 = 2m^4 + 2m^2,$ so $m^4 + m^2 - 2 = 0.$  This factors as $(m^2 - 1)(m^2 + 2) = 0.$  Hence, $m^2 = 1,$ so $m = \pm 1.$

If $m = 1,$ then $b = 2.$  If $m = -1,$ then $b = -2.$  Thus, the two tangents are $y = x + 2$ and $y = -x - 2.$

[asy]
unitsize(0.8 cm);

real upperparab (real x) {
  return (sqrt(8*x));
}

real lowerparab (real x) {
  return (-sqrt(8*x));
}

pair A, B, C, D;

A = (-1,1);
B = (2,4);
C = (-1,-1);
D = (2,-4);

draw(graph(upperparab,0,3));
draw(graph(lowerparab,0,3));
draw(Circle((0,0),sqrt(2)));
draw(interp(A,B,-0.2)--interp(A,B,1.2));
draw(interp(C,D,-0.2)--interp(C,D,1.2));
draw(A--C);
draw(B--D);

label("$y = x + 2$", interp(A,B,1.3), NE);
label("$y = -x - 2$", interp(C,D,1.3), SE);

dot(A);
dot(B);
dot(C);
dot(D);
[/asy]

We look at the tangent $y = x + 2.$  Substituting into $x^2 + y^2 = 2,$ we get
\[x^2 + (x + 2)^2 = 2.\]This simplifies to $x^2 + 2x + 1 = (x + 1)^2 = 0,$ so $x = -1.$  Hence, the tangent point on the circle is $(-1,1).$

We have that $x = y - 2.$  Substituting into $y^2 = 8x,$ we get
\[y^2 = 8(y - 2).\]This simplifies to $(y - 4)^2 = 0,$ so $y = 4.$  Hence, the tangent point on the parabola is $(2,4).$

By symmetry, the other two tangent points are $(-1,-1)$ and $(2,-4).$

The quadrilateral in question is a trapezoid with bases 2 and 8, and height 3, so its area is $\frac{2 + 8}{2} \cdot 3 = \boxed{15}.$
